const useOnSubmit = (user) => {
    const [token, setToken] = useState('');
    useEffect(() => {
        const tokenUser = user?.user;
        const email = tokenUser?.email;
        console.log(email);
    }, [user])
    return [token]
};

export default useOnSubmit;
